import Card from '../UI/Card/Card';
import classes from "./Body.module.css";

const Body = () => {
  return (
    <div className={classes.body}>
      <Card>
        <img src="../../assets/images/20220619_191909.jpg" alt="Ethan holding a dog"></img>
      </Card>
      <Card>
        <img src="../../assets/images/20220627_231841.jpg" alt="Ethan holding a juice box"></img>
      </Card>
    </div>
  );
};

export default Body;
